  <script>
    if (!!window['backend'] && document.location.hostname !== 'localhost') {
      document.write(window['backend']['config']['staticHead']);

  </script>

    [data-app-loader] {
      position: absolute;
      top: 50%;
      left: 50%;
      margin-right: -50%;
      transform: translate(-50%, -50%);
      width: 150px;
    }
  </style>
  <script>
    (function () {
      window.addEventListener('message', function (event) {
        if (event.data === 'application_ready') {
          var loader = document.getElementById('app-loader');
          if (!!loader && !!loader.parentNode) {
            loader.parentNode.removeChild(loader);
          }
        }
      }, false);
    })();
